import React from "react";

import {
	Container,
	TituloContainer,
	BotaoAdicionar,
	VendasContainer,
	InfoContainer,
	InfoCabecalho,
	InfoConteudo,
	InfoItem,
	FormularioContainer,
	FormularioEdicao,
	LadoEsquerdo,
	LadoDireito,
	ImagemUpload,
	BotaoAtualizar,
} from "./PerfilProdutoElementos";

const Produto = () => {
	return (
		<Container>
			<TituloContainer>
				<h1>Produto</h1>
			</TituloContainer>
		</Container>
	);
};

export default Produto;
